import Typography from '@mui/material/Typography';

function App() {

  var people = [
    {
      firstName: "Doug",
      lastName: "Marlin",
      age: 42,

    },
    {
      firstName: "Henry",
      lastName: "Rollins",
      age: 23
    },
    {
      firstName: "Sarah",
      lastName: "Johnson",
      age: 4
    },
    {
      firstName: "Bart",
      lastName: "Rogarts",
      age: 100
    },
    {
      firstName: "Gorno",
      lastName: "Deeker",
      age: 55
    },
  ];

  return (
    <div className="App">
      <Typography variant="h3" gutterBottom>The People</Typography>
    </div>
  );
}

export default App;
